import logo from './logo.svg';
import './App.css';
import DoubleSlider from './doubleSlider';
import React, { useState, useRef, useEffect} from 'react';
import * as tf from '@tensorflow/tfjs';

function App() {
  const [decoder, setDecoder] = useState();
  async function loadModel() {
    try {
      decoder = await tf.loadLayersModel(url.modelLink);
      setDecoder(decoder);
    } catch (err) {
      alert("model loading error....");
    }
  }
  async function secondLoad() {
    let response =  await loadModel();
  }
  const url = {
    modelLink: 'https://storage.googleapis.com/test-tfjs/model.json',
    binData: 'https://storage.googleapis.com/test-tfjs/group1-shard1of1.bin'
  };

  useEffect(async () => decoder = await tf.loadLayersModel(url.modelLink));
  console.log(decoder);
  return (
    <div className="App">
      <header className="App-header">
        <DoubleSlider decoder={decoder}></DoubleSlider>
      </header>

    </div>
  );
}

export default App;
